import React from "react";

const Social = () =>{
    return (
        <div className="home__social">
            <a href="https://www.linkedin.com/in/akindele-oluwasegun/" className="home__social-icon" target="_blank" rel="noreferrer">
            <i class="uil w uil-linkedin"></i>
            </a>

            <a href="https://twitter.com/aksheg" className="home__social-icon" target="_blank" rel="noreferrer" >
            <i class="uil w uil-twitter"></i>
            </a>

            <a href="https://github.com/ukadavid" className="home__social-icon" target="_blank" rel="noreferrer">
            <i class="uil w uil-github"></i>
            </a>
        </div>
    )
}

export default Social;
